INSERT INTO `offre` VALUES (20,23,21,'? Ã€ LA RECHERCHE D\'UN FOYER AIMANT POUR ROKI ?\r\n\r\nSalut Ã  tous les amoureux des animaux! ? Je suis au regret de devoir trouver un nouveau foyer pour mon adorable compagnon Ã  quatre pattes, Roki. ?\r\n\r\nRoki est un chien incroyablement affectueux et joueur. Il adore les cÃ¢lins autant que les balades Ã©nergiques au parc. ? Ã€ 4 ans, il est plein de vie et prÃªt Ã  apporter de la joie Ã  un nouveau foyer. Il est vaccinÃ©, stÃ©rilisÃ© et prÃªt pour une vie de bonheur.\r\n\r\n? Que pouvez-vous attendre de Roki :\r\n\r\nUn compagnon fidÃ¨le\r\nDes moments de joie et de rire\r\nBeaucoup d\'amour et de cÃ¢lins\r\nPrÃªt pour de nouvelles aventures\r\n?â€?â€?â€? Le foyer idÃ©al pour Roki :\r\nNous recherchons une famille aimante qui pourra offrir Ã  Roki l\'attention et les soins dont il a besoin. Un jardin pour jouer serait un bonus, mais l\'amour et l\'engagement sont les Ã©lÃ©ments les plus importants.','2024-02-07 15:46:35'),(21,23,22,'? Ã€ la recherche d\'un foyer temporaire pour mon adorable chat pendant mon voyage ! ?\r\n\r\nChers amis et amoureux des animaux,\r\n\r\nJe suis sur le point de partir en voyage du 15 janvier au 12 fÃ©vrier et je cherche un foyer aimant pour mon adorable chat. Il s\'appelle [Rosa], a [3] ans, et il est un compagnon joyeux et cÃ¢lin.\r\n\r\n\r\nMalheureusement, je ne peux pas l\'emmener avec moi pendant cette pÃ©riode, et je recherche quelqu\'un de confiance qui pourrait prendre soin de lui temporairement. \r\n\r\nSi vous Ãªtes un amoureux des chats et que vous avez de l\'espace dans votre cÅ“ur et chez vous pour accueillir [Nom du chat], veuillez me contacter. Je fournirai tous les articles nÃ©cessaires, y compris sa nourriture prÃ©fÃ©rÃ©e, son lit confortable, et bien sÃ»r, beaucoup d\'amour.\r\n\r\nC\'est une opportunitÃ© pour lui de passer du temps avec une nouvelle famille qui l\'apprÃ©ciera autant que moi. Si vous connaissez quelqu\'un de confiance, n\'hÃ©sitez pas Ã  partager cette publication.\r\n\r\nMerci du fond du cÅ“ur pour votre soutien et votre amour envers nos amis Ã  fourrure. ?','2024-02-07 16:09:57'),(22,25,23,'Bonjour Ã  tous les amoureux des oiseaux ! Pendant mon voyage Ã  l\'Ã©tranger du 13/02 au 19/03, je cherche une Ã¢me attentionnÃ©e pour prendre soin de mon adorable oiseau. Il est joyeux, mÃ©lodieux et s\'adapte facilement. Une compagnie parfaite ! Si vous avez de l\'amour Ã  partager, contactez-moi pour une adoption temporaire. ??','2024-02-09 00:00:52'),(23,25,24,'? Adoptez l\'Ã‰lÃ©gance Aquatique de Mes Poissons ! ??\r\n\r\nPlongez dans un monde d\'Ã©lÃ©gance aquatique en adoptant mes poissons exotiques ! Leur palette de couleurs chatoyantes et leurs danses gracieuses crÃ©ent un spectacle apaisant dans votre propre oasis. Pendant mon absence du 13/02 au 19/03, offrez-leur un foyer chaleureux. Transformez votre espace en un aquarium vivant rempli de vie aquatique. Faites de chaque jour une exploration sous-marine ! ??? AJOUT DES MODIS','2024-02-09 00:09:16');
